import React from 'react';
import './overview-page.scss'
import { Dropdown } from 'carbon-components-react';
import {
  Restart16,
} from '@carbon/icons-react';
import moment from 'moment';

export default class OverviewPage extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      lastUpdated: moment().format('h:mm A')
    }
  }

  render() {
    return <div className="bx--grid bx--grid--full-width overview-page">
            <div className="bx--row padded-row">
              <h1 className="overview-page__heading">Analytics overview</h1>
              <div className="lastRefreshed">
                <Restart16 />
                <p >Last Updated:<br></br>{this.state.lastUpdated}</p>
                </div>
            </div>
            <div className="bx--row padded-row">
              <div className="bx--col-lg-3">
                <p className="mini-header">Choose time period</p>
              </div>
            </div>
            <div className="bx--row engagement-panel">
                <p className="panel-title">Engagement</p>
                <br></br>
                <p className="engagement-num-title" style={{ float: "left", display: "inline-block"}}>Active Users</p>
              </div>
          </div>
  }

}
